> Top News Democrats release Benghazi testimony of top Clinton aide FILE - In this Sept. 3, 2015 file photo, former Hillary Rodham Clinton aide Cheryl Mills listens at left as House Benghazi Committee Chairman Trey Gowdy, R-S.C. speaks to reporters on Capitol Hill in Washington following her deposition before the panel investigating Benghazi. Democrats on the House committee investigating the deadly attacks in Benghazi, Libya, have released a full transcript of testimony by Mills. The release comes a day before Clinton is expected to testify. (AP Photo/Susan Walsh, File) 
